import React, { useState } from 'react';
import '../assets/styles/Nav.css';
import '../assets/styles/App.css';

const Projects = () => {
  return (
    <div className="projects__container">
      <div className='projects__list'>
        <div className='project__item'>
          <div className='project__title'>Project 1</div>
          <div className='project__info'>June 23 // Design UI & UX</div>
        </div>
        <div className='project__item'>
          <div className='project__title'>Project 2</div>
          <div className='project__info'>April 22 // Software Dev</div>
        </div>
                <div className='project__item'>
          <div className='project__title'>Project 3</div>
          <div className='project__info'>March 24 // Malware Dev</div>
        </div>
        <div className='project__item'>
          <div className='project__title'>Project 4</div>
          <div className='project__info'>November 19 // Pentesting</div>
        </div>
        <div className='project__item'>
          <div className='project__title'>Project 5</div>
          <div className='project__info'>September 25 // CyberSec Tools Dev</div>
        </div>
      </div>
    </div>
  );
};

export default Projects;
